import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
import Divider from '@material-ui/core/Divider';

function App() {
  return (
    <div className="app">
      <div className="header-bar">
      </div>
      <AppBar
        title="Title"
        iconClassNameRight="muidocs-icon-navigation-expand-more"
      />

    </div>
  );
}

export default App;
